import React from 'react'
import 'bootstrap/dist/css/bootstrap.min.css'

const Header = () => {
  return (
    <nav className="navbar bg-dark navbar-dark mb-5">
        <div className="container-fluid">
            <a className="navbar-brand" href="#">Navbar</a>
        </div>
    </nav>
  )
}

export default Header
